import React from 'react';
import net_movie from "../images/net_movie.png";
import calculator from "../images/calculator.png";
import list_game from "../images/list_game.png";
import Quiz from "../images/Quiz.png";
import big_quiz from "../images/big_quiz.png";
import right_price from "../images/right_price.png";

const Portfolio = () => {
    return (
        <div className="portfolio">
            <div><img src={net_movie} alt="picture_portfolio" /></div>
            <div><img src={list_game} alt="picture_portfolio" /></div>
            <div><img src={Quiz} alt="picture_portfolio" /></div>
            <div><img src={big_quiz} alt="picture_portfolio" /></div>
            <div><img src={right_price} alt="picture_portfolio" /></div>
            <div><img src={calculator} alt="picture_portfolio" /></div>

        </div>
    );
};

export default Portfolio;
